import React from 'react';
import { Link } from 'react-router-dom';
import './Welcome.css';
import welcomeImage from './images/welcome.jpg';
import logoImage from './images/logo.jpg';

function Welcome() {
    return (
        <div className="welcome-container">
            <header className="welcome-header">
                <img src={logoImage} alt="Logo" className="welcome-logo"/>
                <nav className="welcome-nav">
                    <a href="#" className="nav-link">Home</a>
                    <a href="#" className="nav-link">News</a>
                    <a href="#" className="nav-link">About</a>
                    <a href="#" className="nav-link">Info</a>
                </nav>
                <Link to="/signin" className="sign-in-button">Sign In</Link>
            </header>
            <main className="welcome-content">
                <div className="illustration">
                    <img src={welcomeImage} alt="Library Illustration" className="library-illustration"/>
                </div>
                <div className="text-section">
                    <h1 className="title">Lorem Ipsum</h1>
                    <p className="subtitle">
                        Consectetur adipiscing elit, eiusmod incididunt ut labore et dolore magna aliqua.
                    </p>
                </div>
            </main>
        </div>
    );
}

export default Welcome;
